import './home.css';
import SignInButtonSmall from "./signInButtonSmall";

const NavBar = (props) => {
    return(
        <div className={'navBar'}>
            <span className={'navBar-logo'}>Salvos</span>
            <a href={'https://quizapp-server.herokuapp.com/auth/google'} className={'navBar-a'}>
                <SignInButtonSmall />
            </a>

        </div>
    );
};

export default NavBar;
